rce":{"id":"4f5f3145-8e96-4d55-ac29-3a4e86874fec","type":"ColumnDataSource"}},"code":"\n            // JavaScript code goes here\n            console.log(\"callback-------callback\");\n            var colors = ['#f39c12', \"#1abc9c\", \"#3498db\", \"#2ecc71\", \"#9b59b6\", '#34495e', '#492000', '#960019',\n'#043927', '#8F9779', '#f1c40f', '#e67e22', '#e74c3c', '#7f8c8d'];\n            // the model that triggered the callback is cb_obj:\n            var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            \n            if(b === 0){ //show clusters\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 1){//show num_genes\n                var temp = 0\n                max = Math.max(...data.num_genes)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(92 * data.num_genes[i]/max);\n                    col.push(fullColorHex(temp, 152, 219));\n                    }\n                source.data.color = col;\n            }\n            if(b === 2) { //show genome_size\n                var temp = 0\n                max = Math.max(...data.genome_size)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(252 * data.genome_size[i]/max);\n                    col.push(fullColorHex(temp, 152, 219));\n                    }\n                source.data.color = col;\n            }\n            if(b === 3) {  //show show full/mean CUB diff\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(200 * data.efulldiff[i]);\n                    col.push(fullColorHex(temp, 204, 113));\n                    }\n                source.data.color = col;\n            }\n            if(b === 4){ //Show GC count\n                var temp = 0\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * data.gccount[i]);\n                    col.push(fullColorHex(temp, temp, 113));\n                }\n                data.color = col;\n            }\n            if(b === 5){ //show fullmean GC diff\n                var temp = 0\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * data.gcfulldiff[i]);\n                    col.push(fullColorHex(temp, 204, temp));\n                }\n                data.color = col;\n            }\n            if(b === 6){ //show GC variance\n                var temp = 0\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(455 * data.varGCcount[i]);\n                    col.push(fullColorHex(temp, temp, 113));\n                }\n                data.color = col;\n            }\n            if(b === 7){ //show distance to tRNA UB\"\n                source.data.color = source.data.recent;\n            }\n            if(b === 8){ //  show tRNA number\n                var temp = 0\n                max = Math.max(...data.tRNA_number)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(14 + (240 * data.tRNA_number[i]/max));\n                    col.push(fullColorHex(152, 23, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 9){ //  show avgphilodistance\n                var temp = 0\n                max = Math.max(...data.distances);\n                min = Math.min(...data.distances);\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(254 * (data.distances[i]-min)/(max-min));\n                    col.push(fullColorHex(52, 73, temp));\n                    }\n                source.data.color = col;\n            }\n            /*\n            if(b === 10){ //  show full phylodistance\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(64 + 100 * data.gc[i]));\n                    col.push(fullColorHex(52, 73, temp));\n                    }\n                source.data.color = col;\n            }*/\n            if(b > 10){ \n                for(i=0;i<len;++i){\n                    if(data[String(b)][i]){\n                        col.push(colors[2])\n                    }else{\n                        col.push(colors[3])\n                    }\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"d1c4a6ca-7fff-4d31-9e7b-a5f874ca7f06","type":"CustomJS"},{"attributes":{"children":[{"id":"dbb94db6-608b-478b-b04a-7718e5405f37","type":"WidgetBox"},{"id":"4b449c9f-1f9e-4fbd-b5d6-3fd4eec21438","subtype":"Figure","type":"Plot"}]},"id":"77c280b2-0e78-4097-bfd0-a3f58b52a33f","type":"Column"},{"attributes":{"source":{"id":"4f5f3145-8e96-4d55-ac29-3a4e86874fec","type":"ColumnDataSource"}},"id":"6a7a76d6-f8c8-46ea-b3b1-dece725473b9","type":"CDSView"},{"attributes":{},"id":"92025e3c-1050-46b7-be04-9a5d746657fd","type":"LinearScale"},{"attributes":{"callback":null},"id":"91069bbc-bab0-4909-8841-cb3dfec5b991","type":"DataRange1d"},{"attributes":{"callback":null},"id":"7d49ccfb-7c45-477d-8721-a10c03ac32bc","type":"DataRange1d"},{"attributes":{},"id":"ea170892-9093-4c1d-9f45-60
